import React from 'react';
import './Navbar.css';
import { Link, useNavigate } from 'react-router-dom';

export default function Navbar() {
    return (
        <>
            <nav>
                <ul>
                    <li class="nav"><a href="#">Home</a></li>
                    <li class="nav"><a href="#">About</a></li>
                    <li class="nav stanley"><a href="#" class="stanley">Stanley Cup Sim!!</a></li>
                    <li class="nav nav-right"><a href="https://www.nhl.com/"><img class="nav" src={"../../../05_NHL_Shield.svg.png"} alt="NHL logo"></img></a></li>
                </ul>
            </nav>
        </>
    )
}
